import React from 'react'
import Nav from '../nav'
import './staking.less'
import { makeStyles } from '@material-ui/core/styles';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableContainer from '@material-ui/core/TableContainer';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Paper from '@material-ui/core/Paper';

function createData(tickets, onlineMiners, historicalMiners, blockRewards) {
    return { tickets, onlineMiners, historicalMiners, blockRewards };
}

const rows = [
    createData('Frozen yoghurt', 159, 6.0, 24, 4.0),
    createData('Ice cream sandwich', 237, 9.0, 37, 4.3),
    createData('Eclair', 262, 16.0, 24, 6.0),
    createData('Cupcake', 305, 3.7, 67, 4.3),
    createData('Gingerbread', 356, 16.0, 49, 3.9),
];

export default function index() {
    return (
        <div>
            <div className='home-contiar'>
                <Nav></Nav>
            </div>
            <div className='staking'>
                <header>
                    <h2>Fusion Staking</h2>
                </header>
                <TableContainer component={Paper} className='staking-table'>
                    <Table aria-label="simple table">
                        <TableHead>
                            <TableRow>
                                <TableCell>
                                    <strong className='sum'>Summary</strong>
                                </TableCell>
                            </TableRow>
                        </TableHead>
                        <TableHead>
                            <TableRow>
                                <TableCell>Tickets:</TableCell>
                                <TableCell>Online Miners:</TableCell>
                            </TableRow>
                            <TableRow>
                                <TableCell>Historical Miners:</TableCell>
                                <TableCell>Block Rewards:</TableCell>
                            </TableRow>
                        </TableHead>
                        {/* <TableBody>
                            {rows.map((row) => (
                                <TableRow key={row.name}>
                                    <TableCell component="th" scope="row">
                                        {row.name}
                                    </TableCell>
                                    <TableCell align="right">{row.calories}</TableCell>
                                    <TableCell align="right">{row.fat}</TableCell>
                                    <TableCell align="right">{row.carbs}</TableCell>
                                    <TableCell align="right">{row.protein}</TableCell>
                                </TableRow>
                            ))}
                        </TableBody> */}
                    </Table>
                </TableContainer>
            </div>
        </div>
    )
}
